package br.com.elvisassis;public class Iphone implements ReprodutoMusical, AparelhoTelefonico, NavegadorInternet{    private String modelo;    private String cor;    private int anoFrabricacao;    public void ligar() {        System.out.println("Liganoo o Iphone...");    }    public void desligar(){        System.out.println("Desligando o Iphone...");    }    public String getModelo() {        return modelo;    }    public void setModelo(String modelo) {        this.modelo = modelo;    }    public String getCor() {        return cor;    }    public void setCor(String cor) {        this.cor = cor;    }    public int getAnoFrabricacao() {        return anoFrabricacao;    }    public void setAnoFrabricacao(int anoFrabricacao) {        this.anoFrabricacao = anoFrabricacao;    }    @Override    public void fazerLigacao(String numero) {        System.out.println("Fazendo ligação para o número: " + numero);    }    @Override    public void atenderLigacao() {        System.out.println("Atendendo a ligação");    }    @Override    public void iniciarCorreioVoz() {        System.out.println("Iniciando correio de voz");    }    @Override    public void adicionarContato(String nome, String numero) {        System.out.println("Adicionando o contatoa " + nome + " com o número " + numero);    }    @Override    public void listarContatos() {        System.out.println("listando os contatos");    }    @Override    public void exibirPaginaAtual(String url) {        System.out.println("exibir pagina atual");    }    @Override    public void adicionarNovaAba() {        System.out.println("Adicionando nova aba");    }    @Override    public void atualizarPagina() {        System.out.println("Atualizando página");    }    @Override    public void enviarEmail(String destinatario, String assunto, String corpo) {        System.out.println("Enviando e-mail");    }    @Override    public void receberEmail() {        System.out.println("Recebendo e-mail");    }    @Override    public void tocarMusica(String musica) {        System.out.println("Tocando música");    }    @Override    public void pausarMusica() {        System.out.println("Pausando a música");    }    @Override    public void selecionarMusica() {        System.out.println("Selecionando música");    }}